import React from "react";
import { getAllGarage } from "../API/API";
import "../../style/GarageList.css";

class GarageList extends React.Component{
    constructor(props) {
        super(props);
        this.state = {
            elements: this.props.model.object,
            model: this.props.model,
        }
    }

    async componentDidMount() {
        console.log(this.state.elements);
        await getAllGarage().then(response=>this.setState({elements:response})).catch(error=>console.error(error));
    }

    

    render() {
        return (
            <div className="GarageList">
                <div className="header">
                    <h1 className="col-md-10">{this.state.model.titleList}</h1>
                    <button type="button" className=" col-md-2 btn btn-primary" onClick={() => window.location.pathname = "Garage/Add"}>Ajouter {this.state.model.determinative} {this.state.model.label}</button>
                </div>
                 <table className="table table-dark table table-hover">
                    <thead>
                        <tr>
                            {this.state.model.titles.map((title, index)=>{
                                return(
                                <th key={index} className="col-md-1">{title}</th>
                                )
                            })}
                            <th className="col-md-1"></th>
                        </tr>
                    </thead>
                    <tbody>
                        <tr className={"align-middle"}>
                            {this.state.elements.map((element)=>{
                                return(
                                        this.props.model.tableBody(element)
                                )
                            })}
                        </tr>
                    </tbody>
                </table>
            </div>
        )
    }
}
export default GarageList;
